import React from "react";
import { useContext } from "react";
import { gall } from "../App";
export default function Like() {
  const data = useContext(gall);
  console.log(data);
  return (
    <>
      {data.map((i) =>
        i.map((index, item) => {
          return (
            <div style={{ width: "18rem" }}>
              <div className="">
                <img
                  class="card-img-top"
                  src={index.download_url}
                  alt="Card image cap"
                />
                <div class="card-body">
                  <h5 class="card-title">{index.author}</h5>
                </div>
              </div>
            </div>
          );
        })
      )}
    </>
  );
}
